pol._1_paragraph:
Определения
- Платформа: электронная почта info@dineli.com и все подчиненные страницы;
- Посетитель: лицо, которое посещает Платформу;
- Клиент: человек, который размещает заказ на Платформе.

pol._3_paragraph:
Личные данные
Персональные данные, которые вы нам предоставляете:

Айпи адрес;
серфинг поведение;
источник;
условия поиска;
данные для входа;
адрес электронной почты;
изображение профиля;
Контактная информация.
dineli может собирать данные о вас несколькими способами:

с помощью файлов cookie;
во время вашей регистрации или использования платформы;
запрашивая дополнительную информацию, следуя контактам, которые вы установили с dineli через этот сайт;
при заполнении форм для обсуждения вашей проблемы или контактных лиц;
при вводе, совместном использовании и пересылке данных по вашей инициативе, которыми вы делитесь с другими пользователями на наших сайтах.

pol._4_paragraph:
Цели обработки
dineli будет использовать полученные от вас Персональные данные только в следующих целях:

управление вашей учетной записью на Платформе с целью предоставления вам наилучшего возможного обслуживания на правовой основе
являясь исполнением запрошенного вами соглашения;
отправка вам прямого маркетинга, информационных бюллетеней, рекламных акций и рекламных акций с вашего явного предварительного согласия в качестве законного основания;
адекватно отвечая на ваши вопросы о Платформе или о предоставлении услуг на правовой основе
предоставление услуги, которую вы запросили;
проверка уникальности введенных данных и правдивости дела.
Вы не обязаны раскрывать свои Персональные данные, но понимаете, что предоставление определенных услуг становится
невозможно, если вы откажетесь от обработки.
